import React from "react";
import searchIcon from "../images/search.png"


function Search() {

    return(
        <form className="searchForm">
            <input className="searchInput" type="text" placeholder="nora를 검색해보세요"/>
            <button className="searchButton"><img className="searchIcon"src={searchIcon} alt="" /></button>
        </form>
    )
}
export default Search;
